// Sidebar.js
// frontend/src/Components/Sidebar.js

import React from 'react';
import './Sidebar.css';

const Sidebar = ({ onFilterChange }) => {
    return (
        <div className="sidebar">
            <div className="search-section">
                <input type="text" placeholder="Buscar instrumento..." className="search-input" />
                <button className="andean-button">Buscar</button>
            </div>

            <div className="filters-section">
                <h3>Filtrar por tipo:</h3>
                <button onClick={() => onFilterChange('all')} className="andean-button">Todos</button>
                <button onClick={() => onFilterChange('viento')} className="andean-button">Viento</button>
                <button onClick={() => onFilterChange('cuerda')} className="andean-button">Cuerda</button>
                <button onClick={() => onFilterChange('percusion')} className="andean-button">Percusi√≥n</button>
            </div>
        </div>
    );
};

export default Sidebar;
